import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import ListSubheader from '@mui/material/ListSubheader';
import IconButton from '@mui/material/IconButton';
import LocalMoviesIcon from '@mui/icons-material/LocalMovies';

export default function TitlebarImageList() {
  return (
    <ImageList cols={4} >
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}`}
            srcSet={`${item.img}`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            subtitle={item.author}
            sx={{ width: 1/5 }}
            actionIcon={
              <IconButton
                sx={{ color: 'rgba(255, 255, 255, 0.54)' }}
                aria-label={`info about ${item.title}`}
              >
                <LocalMoviesIcon />
              </IconButton>
            }
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/y4SXcbNl6CEF2t36icuzuBioj7K.jpg',
    title: 'Moonrise Kingdom',
    author: 'Wes Anderson',
  },
  {
    img: 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/q6y0Go1tsGEsmtFryDOJo3dEmqu.jpg',
    title: 'The Shawshank Redemption',
    author: 'Frank Darabont',
  },
  {
    img: 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/eEslKSwcqmiNS6va24Pbxf2UKmJ.jpg',
    title: 'The Godfather',
    author: 'Francis Ford Coppola',
  },
  {
    img: 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg',
    title: "Schindler's List",
    author: 'Steven Spielberg',
  }
];
